            var credential = error.credential;
            // ...
          });
    }

    onSignUp(){
        const { errorMessage, nickname, email, password, lastname, firstname, month, day, year } = this.state
        firebase.auth().createUserWithEmailAndPassword(this.state.email, this.state.password)
            .then((result) =>{
                firebase.firestore().collection("users")
                    .doc(firebase.auth().currentUser.uid)
                    .set({
                        firstname,
                        lastname,
                        nickname,
                        email,
                        password,
                        month,
                        day,
                        year, 
                    })
                this.setState({ newuser : true })
                console.log(result)
                if(result===undefined){
                    return(
                        <div>

                        </div>
                    )
                }

        })
        .catch((error) => {
            this.setState({errorMessage: error.message})
        })
    }

    handleChange = (e) => {
        this.setState({
            [e.target.name]: e.target.value
        })
    }

 render() {
    const {newuser} = this.state
    return(
        <>
        <div className='allr'>

                <Form onSubmit={this.onSignUp} className='loginn'>
                 <Form.Label class='fonz' size='large' id='liso'>SignUp</Form.Label>
                    <Form.Row className='nn' >
                        <Col>
                        <Form.Control name='firstname' type='name' onChange={this.handleChange} placeholder="First name" />
